import './ContactLink.css'

import React from 'react';
import { Link } from 'react-router-dom';

const ContactLink = ({ text }) => {
    return (
        <div >
            <Link className='contact-link' to="/get-in-contact">{text}</Link>
        </div>
    );
};

export default ContactLink;
